import React, {Component} from "react";

class _Navbar extends Component {
    constructor(props) {
        super(props);
        this.state = {
            MenuItems: [
                {
                    title: "Content",
                    url: "#",
                    cName: "nav-links"
                },
                {
                    title: "NewPost",
                    url: "#",
                    cName: "nav-links"
                },
                {
                    title: "MyPosts",
                    url: "#",
                    cName: "nav-links"
                },
                {
                    title: "Home",
                    url: "#",
                    cName: "nav-links"
                }
            ]
            }
        }

    render() {
        return(
            <nav className="NavbarItems">
                <h1 className="navbar-logo">React</h1>
                <div className="menu=icon">

                </div>
                <ul>
                    {}
                    <li><a className="content" ></a></li>
                </ul>
            </nav>
        );
    }
}

export default _Navbar
